import React from 'react';
import ReactDOM from 'react-dom';
import Mainpage from './mainpage.js';
import './index.css';

// import i18n (needs to be bundled ;))
import './i18n.js';

ReactDOM.render(
  <React.StrictMode>

    <Mainpage />
    <div style={{position:"fixed",height:"100vh",zIndex:"50"}}>
              <div style={{backgroundColor:"yellow",width:"600px",marginLeft:"auto",marginRight:"auto"}}></div>
            </div>

  </React.StrictMode>,

  document.getElementById('root')
);
